    <header id="main-header">Sistema React Crud 1.0 &nbsp;


    </header>


);


const route = (
    <Switch>
    <BrowserRouter>
    <div>
        <Route path="/cu" component={Header} exact={true}/>
    </div>
    </BrowserRouter>
    </Switch>
)


export default Header;
